import UpdatedLists from './UpdatedLists'
function Lists(){

    const mobile = [
        {id: 1, name: 'samsung', price: 25000},
        {id: 2, name: 'apple', price: 35000},
        {id: 3, name: 'oppo', price: 15000},
        {id: 4, name: 'realme', price: 18000},

    ]
    return(
        <>
        <UpdatedLists itemName={mobile} category="phone"/>
        </>
    );
}

export default Lists
